import {Switch, Route, Link} from 'react-router-dom';
import ProductOne from '../../components/product-one/product-one.component'

const Products = (props) => {
  const {match} = props;
  console.log(match)
  return (
    <div className='Products'>
    <Link to={`${match.path}/one`}>Jeen</Link>
      <Switch>
        <Route exact path={`${match.path}/one`} component={ProductOne}/>
      </Switch>
    </div>
  );
}

export default Products;
